import styled from "styled-components";

export const Container = styled.div`
  background-color: red;
  height: 120px;
  position: absolute;
  top: 0;
  width: 100%;
  display: flex;


  h1 {
    background-color: blue;
    width: 100%;
    display: flex;
    align-items: center;
  }
`;
